(103, 3, '2013-10-28 11:30:00', 'Refer a Friend v.2.1 by aheadWorks has been released!', 'Update Refer a Friend to v.2.1 and Limit Rule Triggering!', 'http://ecommerce.aheadworks.com/refer-a-friend.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=raf21', 0, 1),
(104, 3, '2013-10-07 11:30:00', 'One Step Checkout v.1.2 by aheadWorks has been released!', 'Reduce the number of checkout steps from 6 to 1 with the updated One Step Checkout module. ', 'http://ecommerce.aheadworks.com/one-step-checkout.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=osc1_2', 0, 1),
(105, 3, '2013-09-27 11:30:00', 'Welcome AJAX Login Pro 1.0 by aheadWorks!', 'Do you know how to make login procedure on your website as comfortable as possible? Try AJAX Login Pro Magento extension and remove annoying page reloading and redirection. ', 'http://ecommerce.aheadworks.com/ajax-login-pro.html?utm_source=feed&utm_medium=zefeed&utm_campaign=ajaxlogin', 0, 1),
(106, 3, '2013-09-18 11:30:00', 'Welcome Gift Wrap 1.0 by aheadWorks!', 'The Gift Wrap Magento extension will allow your customers to wrap products at checkout and leave gift messages before delivery.', 'http://ecommerce.aheadworks.com/gift-wrap.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=giftwrap_release', 0, 1),
(107, 3, '2013-09-11 11:30:00', 'Limited-time offer: Gift Wrap Pre-Order', 'With the Gift Wrap module, your clients can easily wrap their products and leave "Best Wishes" message before the delivery.', 'http://ecommerce.aheadworks.com/gift-wrap.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=giftwrap', 0, 1),
(108, 3, '2013-09-04 11:30:00', 'Limited-time offer: AJAX Login Pro Pre-Order', 'Let your visitors create accounts, log in, or recover passwords without annoying page redirections and reloadings.', 'http://ecommerce.aheadworks.com/ajax-login-pro.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=ajaxlogin', 0, 1),
(109, 3, '2013-08-27 11:30:00', 'Welcome Event Tickets 1.0 by aheadWorks!', 'Create Events and Sell Tickets for Them Online with The Event Tickets Magento Extension', 'http://ecommerce.aheadworks.com/event-tickets.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=eventtickets10', 0, 1),
(110, 3, '2013-08-20 11:30:00', 'Limited-time offer: Event Tickets Pre-Order', 'New Magento tool: have you thought of selling tickets online?', 'http://ecommerce.aheadworks.com/event-tickets.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=eventtickets', 0, 1),
(111, 3, '2013-08-16 08:29:25', 'Weekend Sale - $25 OFF Store Activity Live Stream', 'Only $75 for advanced Activitivy live stream extension. See demo and details now', 'http://ecommerce.aheadworks.com/magento-extensions/activity-stream.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=activity_live_stream', 0, 1),
(112, 3, '2013-08-01 09:13:20', 'aheadMetrics - new reporting tool from aheadWorks', 'A new version of aheadMetrics is out! aheadMetrics gives you the all-round analytics of your Magento store. All the sales, customer and product data measured in any dimensions in real-time. The service is free of charge.', 'http://www.aheadmetrics.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=aheadmetrics', 0, 1);
