INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '<ul>\r\n<li><a href="{{store direct_url="about-magento-demo-store"}}">Over ons</a></li>\r\n<li><a href="{{store direct_url="customer-service"}}">Klantenservice</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2013-02-28 17:35:55', '2013-03-12 08:58:35', 1),
(2, 'Footer Block 1', 'footer_block1', '<h2>Navigatie</h2>\r\n<ul>\r\n<li><a href="#">Home</a></li>\r\n<li><a href="#">Wijnen</a></li>\r\n<li><a href="#">Regio''s</a></li>\r\n<li><a href="#">Wijnhuizen</a></li>\r\n<li><a href="#">Producten</a></li>\r\n<li><a href="#">Recepten</a></li>\r\n<li><a href="#">Nieuws & Blog</a></li>\r\n<li><a href="#">Contact</a></li>\r\n</ul>', '2013-11-14 00:56:12', '2013-11-14 00:56:12', 1),
(3, 'Footer Block 2', 'footer_block2', '<h2>Dienstverlening</h2>	\r\n<ul>\r\n<li><a href="#">Verkoopsvoorwaarden</a></li>\r\n<li><a href="#">Privacy</a></li>\r\n<li><a href="#">Leveringen</a></li>\r\n<li><a href="#">Betalingen</a></li>\r\n<li><a href="#">Terugname goederen</a></li>\r\n<li><a href="#">Bedrijven</a></li>\r\n<li><a href="#">Horeca</a></li>\r\n</ul>', '2013-11-14 00:57:20', '2013-11-14 00:57:20', 1),
(4, 'Footer Block 3', 'footer_block3', '<h2>Allerlei</h2>	\r\n<ul>\r\n<li><a href="#">Geschenkverpakkingen</a></li>\r\n<li><a href="#">Cadeaubon</a></li>\r\n<li><a href="#">Eindejaarsgeschenken</a></li>\r\n<li><a href="#">Thuisproeverijen</a></li>\r\n<li><a href="#">Degustaties</a></li>\r\n<li><a href="#">Paketten</a></li>\r\n</ul>', '2013-11-14 00:58:13', '2013-11-14 00:58:13', 1),
(5, 'Footer Block 4', 'footer_block4', '<h2>Contactgegevens</h2>	\r\n<p>bere.bene<br /> Veemarkt 7A<br /> 2500 Lier<br /> Belgie</p>\r\n<h2>Openingsuren winkel</h2>\r\n<p>Open op vrijdag & zaterdag<br /> Van 10u tot 12u en van 14u tot 18u</p>', '2013-11-14 00:59:02', '2013-11-14 00:59:02', 1),
(6, 'Home About Bere.Bene', 'home_about_berebene', '<h2 class="title">Over bere.bene</h2>\r\n<p>Wij zijn invoerder en detailhandel van Italiaanse wijnen. Onze wijnen zijn afkomstig van wijnhuizen die representatief zijn voor jun regio en streek en werken met autochtone druivenrassen.</p>\r\n<p>De wijnhuizen die we vertegenwoordigen zijn Bonotto delle Tezze, Corte Adami en De stefani uit de Veneto, Corte D''Aibo, Tre Monti en Ca'' di Sopra uit Emilia-Romagna, Mate, Tenuta Casteani, Montechiaro, Badia a Coltibuano en Svoltacarrozze uit Toscane, Michele Biancardi en Podere29 uit Puglia, Filippo Gallino en Casa Molissa uit Piemonte en Failoni, Poderi del Coili, La Distesa en Romagnoli uit Le Marche.</p>', '2013-11-14 04:40:01', '2013-11-14 04:41:59', 1),
(7, 'Home Sidebar Block 1', 'home_sidebar_block_1', '<div class="block-title">Trouwe klanten</div>\r\n<div class="block-content"><p>Trouwe klanten belonen we graag. Klik hier en ontdek hoe wij als trouwe klant kunnen belonen.</p></div>', '2013-11-14 04:45:20', '2013-11-14 04:45:20', 1),
(8, 'Home Sidebar Block 2', 'home_sidebar_block_2', '<div class="block-title">Nieuwsbrief</div>\r\n<div class="block-content">\r\n<p>Nieuwsbrief. Schrijf u in en blijf op de hoogte van het nieuws, de komende evenementen en speciale acties van bere.bene en mangiare.bene.</p>\r\n<!--<div class="newsletter-box">\r\n<div class="form-subscribe"><input type="text" /> <button class="button"><span><span>aanmelden</span></span></button>\r\n<div class="cls">&nbsp;</div>\r\n</div>\r\n</div>-->\r\n</div>\r\n<div>{{block type="newsletter/subscribe" name="left.newsletter" template="newsletter/subscribe.phtml"}}</div>', '2013-11-14 04:47:52', '2013-11-14 05:21:32', 1),
(9, 'Home Sidebar Block 3', 'home_sidebar_block_3', '<div class="block-title">facebook</div>\r\n<div class="block-content">\r\n<p>Trouwe klanten belonen we graag. Klik hier en ontdek hoe wij als trouwe klant kunnen belonen.</p>\r\n<img src="{{media url="wysiwyg/facebook-like.png"}}" alt="" /></div>', '2013-11-14 04:50:08', '2013-11-14 05:03:11', 1),
(10, 'Home Sidebar Block 4', 'home_sidebar_block_4', '<div class="block-title">Verzenden</div>\r\n<div class="block-content">\r\n<p>Verzenden doen we in België en Nederland met betrouwbare partners en u kan kiezen uit diverse mogelijkheden. U kan uw bestelling komen afhalen, laten leveren in een kiala-punt naar keuze of laten verzenden via bPost of DPD.</p>\r\n</div>', '2013-11-14 04:51:39', '2013-11-14 04:51:39', 1),
(11, 'Home Sidebar Block 5', 'home_sidebar_block_5', '<div class="block-title">Online betalen</div>\r\n<div class="block-content">\r\n<p>Online betalen  verloopt bij ons veilig via Ogone. Wil je meer weten over de betaalmogelijkheden en veiligheid klik dan hier voor meer info. U kan op deze website zowel onze wijnen als producten in een beweging kopen.</p>\r\n</div>\r\n            ', '2013-11-14 04:52:16', '2013-11-14 04:52:16', 1),
(12, 'Home Slider', 'home_slider', '<div class="slider">{{block type="flexslider/view" name="flexslider_home_slider" template="flexslider/template.phtml" code="home_slider"}}</div>', '2013-11-14 05:44:04', '2013-11-14 05:58:24', 1);
