INSERT INTO `core_email_template` (`template_id`, `template_code`, `template_text`, `template_styles`, `template_type`, `template_subject`, `template_sender_name`, `template_sender_email`, `added_at`, `modified_at`, `orig_template_code`, `orig_template_variables`) VALUES
(1, 'Bestellingsupdate', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                <strong>Beste {{var order.getCustomerName()}}</strong>,<br/><BR>\r\n                    Uw bestelling # {{var order.increment_id}} is<br/>\r\n                    <strong>{{var order.getStatusLabel()}}</strong>.\r\n                </p>\r\n                <p>U kunt de status van uw bestelling controleren door  <a href="{{store url="customer/account/"}}" style="color:#1E7EC8;">in te loggen op uw account</a>.</p>\r\n                <p>{{var comment}}</p>\r\n               <BR>Wanneer er nog vragen zjin dan kunt u ons bereiken via {{config path="trans_email/ident_general/email"}}.<BR><BR>\r\n                <p>Met vriendelijke groet,<br/>\r\n                  <strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, '{{var order.getStoreGroupName()}}: Bestelnummer {{var order.increment_id}} update', NULL, NULL, NULL, '2013-03-10 13:18:42', 'sales_email_order_comment_template', NULL),
(2, 'Bestellingsupdate gast', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                <strong>Beste {{var order.getCustomerName()}}</strong>,<br/><BR>\r\n                    Uw bestelling # {{var order.increment_id}} is<br/>\r\n                    <strong>{{var order.getStatusLabel()}}</strong>.\r\n                </p>\r\n               <BR>Wanneer er nog vragen zjin dan kunt u ons bereiken via {{config path="trans_email/ident_general/email"}}.<BR><BR>\r\n                <p>Met vriendelijke groet,<br/>\r\n                  <strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, '{{var order.getStoreGroupName()}}: Bestelnummer {{var order.increment_id}} update', NULL, NULL, NULL, '2013-03-10 13:18:33', 'sales_email_order_comment_guest_template', NULL),
(3, 'Betaling mislukt', '<table>\r\n    <thead>\r\n        <tr>\r\n            <th>De volgende betaling is mislukt.</th>\r\n        </tr>\r\n    </thead>\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n                <p>\r\n                    <b>Reden:</b><br />\r\n                    {{var reason}}\r\n                </p>\r\n                <p>\r\n                    <b>Klant:</b><br />\r\n                    <a href="mailto:{{var customerEmail}}">{{var customer}}</a> &lt;{{var customerEmail}}&gt;\r\n                </p>\r\n                <p>\r\n                    <b>Producten</b><br />\r\n                    {{var items}}\r\n                </p>\r\n                <p>\r\n                    <b>Totaal:</b><br />\r\n                    {{var total}}\r\n                </p>\r\n                <p>\r\n                    <b>Factuuradres:</b><br />\r\n                    {{var billingAddress.format(''html'')}}\r\n                </p>\r\n                <p>\r\n                    <b>Verzendadres:</b><br />\r\n                    {{var shippingAddress.format(''html'')}}\r\n                </p>\r\n                <p>\r\n                    <b>Verzendmethode:</b><br />\r\n                    {{var shippingMethod}}\r\n                </p>\r\n                <p>\r\n                    <b>Betaalmethode:</b><br />\r\n                    {{var paymentMethod}}\r\n                </p>\r\n                <p>\r\n                    <b>Datum en Tijd:</b><br />\r\n                    {{var dateAndTime}}\r\n                </p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>', NULL, 2, 'Herinnering: Een betalingstransactie is mislukt', NULL, NULL, NULL, '2013-03-10 13:20:03', 'checkout_payment_failed_template', NULL),
(4, 'Bevestigingscode nieuw account', '<style type="text/css">\r\nbody,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }\r\n</style>\r\n\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n    <table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n        <tr>\r\n            <td align="center" valign="top">\r\n                <!-- [ header starts here] -->\r\n                <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                    <tr>\r\n                        <td valign="top">\r\n                            <a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var customer.store.website.name}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n                    </tr>\r\n                </table>\r\n\r\n                <!-- [ middle starts here] -->\r\n                <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                    <tr>\r\n                        <td valign="top">\r\n                            <p><strong>Beste {{var customer.firstname}}</strong>, <br/> Dank u voor uw aanmelding.</p>\r\n\r\n                            <p>Uw emailadres {{var customer.email}} moet worden bevestigd om op de website te kunnen inloggen.</p>\r\n\r\n                            <p>Om te bevestigen klikt u <a href="{{store url="customer/account/confirm/" _query_id=$customer.id _query_key=$customer.confirmation _query_back_url=$back_url}}" style="color:#1E7EC8;">deze bevestigingslink</a>. U wordt direct ingelogt op de website. De link kan maar een keer gebruikt worden.</p>\r\n\r\n														<BR>\r\n                            <p>Met vriendelijke groet,</p>\r\n														<p><strong>{{var customer.store.website.name}}</strong></p\r\n														<p><i>Heeft u zichzelf niet aangemeld? Dan kunt u deze email als niet verzonden beschouwen.</i></p>\r\n                        </td>\r\n                    </tr>\r\n                </table>\r\n\r\n            </td>\r\n        </tr>\r\n    </table>\r\n</div>', NULL, 2, 'Bevestig uw account {{var customer.name}}', NULL, NULL, NULL, '2013-03-10 13:21:16', 'customer_create_account_email_confirmation_template', NULL),
(5, 'Contactformulier', 'Een nieuw bericht vanaf de site is aan u verstuurd.\r\n\r\nNaam: {{var data.name}}\r\nE-mail: {{var data.email}}\r\nTelefoon: {{var data.telephone}}\r\n\r\nBericht: {{var data.comment}}', NULL, 1, 'Contact via website formulier', NULL, NULL, NULL, '2013-03-10 13:21:49', 'contacts_email_email_template', NULL),
(6, 'Creditnota geupdate', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                    <strong>Beste {{var order.getCustomerName()}}</strong>,<br/>\r\n<br/>\r\n                    <strong>{{var order.getStatusLabel()}}</strong>.\r\n                </p>\r\n                <p>U kunt de status van uw order controleren door <a href="{{store url="customer/account/"}}" style="color:#1E7EC8;">in te loggen op uw account</a>.</p>\r\n              <p>{{var comment}}</p>\r\n<BR><BR>\r\n              		<p>Met vriendelijke groet,</p>\r\n                    <p><strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, '{{var order.getStoreGroupName()}}: Creditnota  {{var creditmemo.increment_id}} update', NULL, NULL, NULL, '2013-03-10 13:23:10', 'sales_email_creditmemo_comment_template', NULL),
(7, 'Creditnota update gast', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                    <strong>Beste {{var billing.getName()}}</strong>,<br/><BR>\r\n                  Uw bestelling  {{var order.increment_id}} is <br/>\r\n                    <strong>{{var order.getStatusLabel()}}</strong>.\r\n                </p>\r\n                <p>{{var comment}}</p>\r\n<BR><BR>\r\n              <p>Met vriendelijke groet,</p>\r\n                    <p><strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, '{{var order.getStoreGroupName()}}: Creditnota  {{var creditmemo.increment_id}} update', NULL, NULL, NULL, '2013-03-10 13:23:59', 'sales_email_creditmemo_comment_guest_template', NULL),
(8, 'Fout e-mail template Cron fout', 'Product / cron waarschuwingen:\r\n\r\n{{var warnings}}', NULL, 2, 'Product waarschuwing Cron fout', NULL, NULL, NULL, '2013-03-10 13:24:26', 'catalog_productalert_cron_error_email_template', NULL),
(9, 'Deel verlanglijst', '<style type="text/css">\r\n    body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }\r\n</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n    <table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n        <tr>\r\n            <td align="center" valign="top">\r\n            <!-- [ header starts here] -->\r\n                <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                    <tr>\r\n                        <td valign="top">\r\n                            <p><a href="{{store url=""}}" style="color:#1E7EC8;"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var customer.store.website.name}}" border="0"/></a></p></td>\r\n                    </tr>\r\n                </table>\r\n\r\n            <!-- [ middle starts here] -->\r\n                <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                    <tr>\r\n                        <td valign="top">\r\n                        <p>Beste,<br/><BR>\r\n                        Op {{config path="web/unsecure/base_url"}} heb ik een verlanglijstje ingevuld. Klik op onderstaande link om ze te bekijken. </p>\r\n\r\n<p>{{var message}}</p>\r\n\r\n                        {{var items}}\r\n\r\n                        <br/>\r\n\r\n{{depend salable}}<p><strong><a href="{{var addAllLink}}" style="color:#DC6809;">Alle producten aan winkelwagen toevoegen.</a></strong> |{{/depend}} <strong><a href="{{var viewOnSiteLink}}" style="color:#1E7EC8;">Alle producten van de verlanglijst bekijken.</a></strong></p>\r\n\r\n                        <p>Bedankt,<br/><strong>{{var customer.name}}</strong></p>\r\n\r\n\r\n                        </td>\r\n                    </tr>\r\n                </table>\r\n\r\n            </td>\r\n        </tr>\r\n    </table>\r\n    </div> ', NULL, 2, '{{var customer.name}} heeft u uitnodigd zijn/haar verlanglijst te bekijken', NULL, NULL, NULL, '2013-03-10 13:29:15', 'wishlist_email_email_template', NULL),
(10, 'Factuur updaten', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                    <strong>Beste {{var order.getCustomerName()}}</strong>,<br/><BR>\r\n                Uw bestelling met nummer {{var order.increment_id}} is <br/>\r\n                    <strong>{{var order.getStatusLabel()}}</strong>.\r\n                </p>\r\n                <p>U kunt de status van uw bestelling controleren door  <a href="{{store url="customer/account/"}}" style="color:#1E7EC8;">in te loggen op uw account</a>.</p>\r\n              <p>{{var comment}}</p>\r\n<BR><BR>\r\n										   <p>Met vriendelijke groet,</p>\r\n                    <p><strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, '{{var order.getStoreGroupName()}}: Factuur  {{var invoice.increment_id}} update', NULL, NULL, NULL, '2013-03-10 13:30:32', 'sales_email_invoice_comment_template', NULL),
(11, 'Factuur update gast', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                    <strong>Beste {{var order.getCustomerName()}}</strong>,<br/><BR>\r\n                Uw bestelling met nummer {{var order.increment_id}} is <br/>\r\n                    <strong>{{var order.getStatusLabel()}}</strong>.\r\n                </p>\r\n<BR>\r\n              <p>{{var comment}}</p>\r\n<BR><BR>\r\n										   <p>Met vriendelijke groet,</p>\r\n                    <p><strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, '{{var order.getStoreGroupName()}}: Factuur # {{var invoice.increment_id}} update', NULL, NULL, NULL, '2013-03-10 13:30:56', 'sales_email_invoice_comment_guest_template', NULL),
(12, 'Wachtwoord vergeten', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                    <strong>Beste {{var order.getCustomerName()}}</strong>,<br/><BR>\r\n               U heeft een aanvraag gedaan voor een nieuw wachtwoord. Klik op onderstaande link om een nieuw wachtwoord aan te maken.<BR><BR>\r\n<a href="{{store url="customer/account/resetpassword/" _query_id=$customer.id _query_token=$customer.rp_token}}" style="color:#1E7EC8;">{{store url="customer/account/resetpassword/" _query_id=$customer.id _query_token=$customer.rp_token}}</a>\r\n<BR><BR>\r\n										   <p>Met vriendelijke groet,</p>\r\n                    <p><strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, 'Wachtwoord reset', NULL, NULL, NULL, '2013-03-10 13:34:31', NULL, NULL),
