       <td valign="top" style="padding:7px 9px 9px 9px; border:1px solid #bebcb7; border-top:0; background:#f8f7f5;">\r\n                                {{var order.shipping_description}}\r\n                            </td>\r\n                        </tr>\r\n                        </tbody>\r\n                    </table>\r\n                    <br/>\r\n\r\n                    {{layout handle="sales_email_order_shipment_items" shipment=$shipment order=$order}}\r\n\r\n                    <br/>\r\n                    {{block type=''core/template'' area=''frontend'' template=''email/order/shipment/track.phtml'' shipment=$shipment order=$order}}\r\n                    <p>{{var comment}}</p>\r\n                    <p>\r\n                        Met vriendelijke groet,<br/><strong>{{var order.getStoreGroupName()}}</strong>\r\n                    </p>\r\n                </td>\r\n          </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, '{{var order.getStoreGroupName()}}: Verzend # {{var shipment.increment_id}} voor Bestelling # {{var order.increment_id}}', NULL, NULL, NULL, '2013-03-10 14:02:54', 'sales_email_shipment_guest_template', NULL),
(23, 'Nieuwsbrief abonnenemtsbevestiging', '<style type="text/css">\r\nbody,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }\r\n</style>\r\n\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n    <table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n        <tr>\r\n            <td align="center" valign="top">\r\n                <!-- [ header starts here] -->\r\n                <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                    <tr>\r\n                        <td valign="top">\r\n                            <p><a href="{{store url=""}}" style="color:#1E7EC8;"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var customer.store.website.name}}" border="0"/></a></p></td>\r\n                    </tr>\r\n                </table>\r\n\r\n                <!-- [ middle starts here] -->\r\n                <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                    <tr>\r\n                        <td valign="top">\r\n                            <p><strong>Beste {{var customer.firstname}}</strong>,<br/><BR>\r\n                            Hartelijk dank voor uw interesse in onze nieuwsbrief.</p>\r\n                            <p style="border:1px solid #BEBCB7; padding:13px 18px; background:#F8F7F5; ">Om de nieuwsbrief te ontvangen, dient u het abonnement te bevestigen door op de onderstaande link te klikken:<br />\r\n                            <a href="{{var subscriber.getConfirmationLink()}}" style="color:#1E7EC8;">{{var subscriber.getConfirmationLink()}}</a><p>\r\n\r\n                            <p>Met vriendelijke groet,</p>\r\n														<p><strong>{{var customer.store.website.name}}</strong></p>\r\n\r\n\r\n                      </td>\r\n                    </tr>\r\n                </table>\r\n            </td>\r\n        </tr>\r\n    </table>\r\n</div>', NULL, 2, 'Nieuwsbrief aanmelding bevestiging', NULL, NULL, NULL, '2013-03-10 14:03:46', 'newsletter_subscription_confirm_email_template', NULL),
(25, 'Nieuwsbrief aanmelding akkoord', 'U bent succesvol aangemeld voor de nieuwsbrief. Dank u voor uw interesse.', NULL, 2, 'Nieuwsbrief aanmelding gelukt', NULL, NULL, NULL, '2013-03-10 14:04:58', 'newsletter_subscription_success_email_template', NULL),
(26, 'Nieuwsbrief opzegging', 'U bent succesvol uitgeschreven van onze nieuwsbrief. Wellicht tot ziens!', NULL, 2, 'Nieuwsbrief uitschrijving succesvol', NULL, NULL, NULL, '2013-03-10 14:05:17', 'newsletter_subscription_un_email_template', NULL),
(27, 'Prijswijziging', 'Beste {{var customer.firstname}},\r\n\r\nHet is ons een genoegen de volgende prijswijzigingen aan u door te geven:\r\n\r\n{{var alertGrid}}', NULL, 2, 'Prijswijzigingen', NULL, NULL, NULL, '2013-03-10 14:05:34', 'catalog_productalert_email_price_template', NULL),
(28, 'Nieuw wachtwoord', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n    <table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n        <tr>\r\n            <td align="center" valign="top">\r\n                <!-- [ header starts here] -->\r\n                <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                    <tr>\r\n                        <td valign="top">\r\n                            <p><a href="{{store url=""}}" style="color:#1E7EC8;"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var customer.store.website.name}}" border="0"/></a></p></td>\r\n                    </tr>\r\n                </table>\r\n\r\n                <!-- [ middle starts here] -->\r\n                <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n                    <tr>\r\n                        <td valign="top">\r\n<p><strong>Beste {{var customer.firstname}}</strong>,<br/><BR>\r\nUw nieuwe wachtwoord is: {{var customer.password}}</p>\r\n<p>U kunt uw wachtwoord op ieder moment wijzigen via <a href="{{store url="customer/account/"}}" style="color:#1E7EC8;">Mijn account</a>.\r\n<p>\r\n                           <p>Met vriendelijke groet,</p>\r\n														<p><strong>{{var customer.store.website.name}}</strong></p>\r\n                        </td>\r\n                    </tr>\r\n                </table>\r\n\r\n            </td>\r\n        </tr>\r\n    </table>\r\n</div>', NULL, 2, 'Nieuw wachtwoord voor {{var customer.name}}', NULL, NULL, NULL, '2013-03-10 14:07:30', 'customer_password_remind_email_template', NULL),
(29, 'Tell a friend', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                   \r\nHet volgende product is door een vriend van u speciaal voor u geselecteerd. U kunt de link volgen voor meer informatie over dit artikel<br /><br />{{var product_image}} <a href="{{var product_url}}">{{var product_name}}</a><br /><br />\r\nBericht van {{var sender_name}}:<br />{{var message}}<br /><br />\r\n\r\n\r\n										   <p>Met vriendelijke groet,</p>\r\n                    <p><strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>\r\n\r\n', NULL, 2, '{{var sender_name}} selecteerde {{var product_name}} voor u.', NULL, NULL, NULL, '2013-03-10 14:09:34', 'sendfriend_email_template', NULL),
(30, 'Verzending update', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                    <strong>Beste {{var order.getCustomerName()}}</strong>,<br/><BR>\r\n                    Uw bestelling  {{var order.increment_id}} is <br/>\r\n                    <strong>{{var order.getStatusLabel()}}</strong>.\r\n                </p>\r\n                <p>U kunt de status van uw order controleren door  <a href="{{store url="customer/account/"}}" style="color:#1E7EC8;">op uw account in te loggen</a>.</p>\r\n              <p>{{var comment}}</p>\r\n<BR><BR>\r\n              <p>Met vriendelijke groet,<br/><strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, '{{var order.getStoreGroupName()}}: Verzend {{var shipment.increment_id}} update', NULL, NULL, NULL, '2013-03-10 14:10:25', 'sales_email_shipment_comment_template', NULL),
(31, 'Verzending update gast', '<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                    <strong>Beste {{var order.getCustomerName()}}</strong>,<br/><BR>\r\n                    Uw bestelling  {{var order.increment_id}} is <br/>\r\n                    <strong>{{var order.getStatusLabel()}}</strong>.\r\n                </p>\r\n\r\n              <p>{{var comment}}</p>\r\n<BR><BR>\r\n              <p>Met vriendelijke groet,<br/><strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, '{{var order.getStoreGroupName()}}: Verzend {{var shipment.increment_id}} update', NULL, NULL, NULL, '2013-03-10 14:10:53', 'sales_email_shipment_comment_guest_template', NULL),
(32, 'Voorraadmelding', '\r\n<style type="text/css">body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }</style>\r\n<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var order.getStoreGroupName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n        </tr>\r\n        </table>\r\n\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n        <tr>\r\n            <td valign="top">\r\n                <p>\r\n                    <strong>Beste {{var order.getCustomerName()}}</strong>,<br/><BR>\r\n           De volgende producten zijn weer op voorraad:<BR>\r\n\r\n{{var alertGrid}}\r\n<BR><BR>\r\n										   <p>Met vriendelijke groet,</p>\r\n                    <p><strong>{{var order.getStoreGroupName()}}</strong></p>\r\n            </td>\r\n        </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', NULL, 2, 'Producten weer op voorraad', NULL, NULL, NULL, '2013-03-10 14:15:57', 'catalog_productalert_email_stock_template', NULL);
