INSERT INTO `newsletter_template` (`template_id`, `template_code`, `template_text`, `template_text_preprocessed`, `template_styles`, `template_type`, `template_subject`, `template_sender_name`, `template_sender_email`, `template_actual`, `added_at`, `modified_at`) VALUES
(1, 'AW Happy Birthday', '\n<h1 style="color:#184AA4; size:large;">Dear {{var customer_name}}!</h1>\n<p>Here''s wishing that your Birthday<br />\nIs just as special as you.<br />\nA day packed full of happiness,<br />\nThat will last the whole year through.</p>\n{{depend has_coupon}}<p>Your coupon code is: {{var coupon.code}}, expires at {{var coupon.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.1.code}}, expires at {{var coupons.1.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.2.code}}, expires at {{var coupons.2.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.test.code}}, expires at {{var coupons.test.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.test_alias.code}}, expires at {{var coupons.test_alias.expiration_date}}</p>\n{{/depend}}\n<br />\n<img src="{{skin url=''images/699.jpg''}}" border="0" width="322" height="448" align="center" />\n', NULL, NULL, 1, 'Happy Birthday', 'AW', 'aw@aw.com', 1, '2013-11-13 04:32:22', '2013-11-13 04:32:22'),
(2, 'AW Birthday 2', '\n<h1 style="color:#E63513; size:large;">Dear {{var customer_name}}!</h1>\n<p>In soft gleaming night of stars,<br />\nMay all your dreams come true.<br />\nMay every star of every night,<br />\nBring love and joy to you!</p>\n{{depend has_coupon}}<p>Your coupon code is: {{var coupon.code}}, expires at {{var coupon.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.1.code}}, expires at {{var coupons.1.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.2.code}}, expires at {{var coupons.2.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.test.code}}, expires at {{var coupons.test.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.test_alias.code}}, expires at {{var coupons.test_alias.expiration_date}}</p>\n{{/depend}}\n<br />\n<img src="{{skin url=''images/BD.jpg''}}" border="0" />\n', NULL, NULL, 1, 'Happy Birthday', 'AW', 'aw@aw.com', 1, '2013-11-13 04:32:22', '2013-11-13 04:32:22'),
(3, 'AW Customer log in', '\n<p>Dear {{var customer_name}}!</p>\n<p>Thank you for coming back to us!</p>\n{{depend has_coupon}}<p>Your coupon code is: {{var coupon.code}}, expires at {{var coupon.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.1.code}}, expires at {{var coupons.1.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.2.code}}, expires at {{var coupons.2.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.test.code}}, expires at {{var coupons.test.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.test_alias.code}}, expires at {{var coupons.test_alias.expiration_date}}</p>\n{{/depend}}\n', NULL, NULL, 1, 'Customer log in', 'AW', 'aw@aw.com', 1, '2013-11-13 04:32:22', '2013-11-13 04:32:22'),
(4, 'AW Not logged in for some time', '\n<p>Dear {{var customer_name}}!</p>\n<p>You have a membership account in the YOUR STORE NAME.</p>\n<p>New products that can awake your interest have appeared in our store since your last visit.</p>\n<p>Please follow the link to find out all the changes:<br />\n<a href="{{store url=""}}/">YOUR STORE</a></p>\n{{depend has_coupon}}<p>Your coupon code is: {{var coupon.code}}, expires at {{var coupon.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.1.code}}, expires at {{var coupons.1.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.2.code}}, expires at {{var coupons.2.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.test.code}}, expires at {{var coupons.test.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.test_alias.code}}, expires at {{var coupons.test_alias.expiration_date}}</p>\n{{/depend}}\n', NULL, NULL, 1, 'Not logged in for some time', 'AW', 'aw@aw.com', 1, '2013-11-13 04:32:22', '2013-11-13 04:32:22'),
(5, 'AW Your cart has been abandoned', '\n<h1>Dear {{var customer_name}}!</h1>\n\n<p>On {{var quote.updatedAt|formatDateTime:long}} you left a cart in our shop with the following content:</p>\n\n<table width=100% border=1 cellspacing=1 cellpadding=5>\n<tr>\n  <th>No</th>\n  <th>Product</th>\n  <th>Image</th>\n  <th>Description</th>\n  <th>SKU</th>\n  <th>Price</th>\n  <th>Qty</th>\n  <th>Row Total</th>\n</tr>\n\n{{foreach var="$quote.getAllVisibleItems()" template="nsltr:AW Abandoned cart row"}}\n\n<tr>\n  <th colspan=5 align=left>Rows total: {{var row_item_row_number}}</th>\n  <th colspan=3>\n    <table width=100% cellspacing=0 cellpadding="10" style="background-color:yellow">\n        <tr>\n            <td align="left">Discount:</td>\n            <td align="right">{{var quote.totalDiscount|formatPrice}}</td>\n        </tr>\n        <tr>\n            <td align="left">Total:</td>\n            <td align="right">{{var quote.grandTotal|formatPrice}}</td>\n        </tr>\n    </table>\n</tr>\n</table>\n\n<p>Please come back and take it here: <a href="{{var url_resume}}">Your cart link</a></p>\n{{depend has_coupon}}<p>Your coupon code is: {{var coupon.code}}, expires at {{var coupon.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.1.code}}, expires at {{var coupons.1.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.2.code}}, expires at {{var coupons.2.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.test.code}}, expires at {{var coupons.test.expiration_date}}</p>\n<p>Your coupon code is: {{var coupons.test_alias.code}}, expires at {{var coupons.test_alias.expiration_date}}</p>\n{{/depend}}\n<br>\n<a href="{{var url_unsubscribe}}">Unsubscribe</a><br>\n<br>\n<br>\n<hr>\n', NULL, NULL, 1, 'You have abandoned your cart in our store', 'AW', 'aw@aw.com', 1, '2013-11-13 04:32:22', '2013-11-13 04:32:22'),
(6, 'AW Abandoned cart row', '\n<tr>\n  <td>{{var row_item_row_number}}</td>\n  <td><a href="{{store url="catalog/product/view" id="$row_item.product.id"}}">{{var row_item.name}}</a></td>\n  <td align="center"><img src="{{thumbnail size="75" source="row_item.product"}}"/></td>\n  <td>{{var row_item.product.description}}&nbsp;</td>\n  <td>{{var row_item.sku}}</td>\n  <td align="right"><nobr>{{var row_item.priceInclTax|formatPrice}}</nobr></td>\n  <td align="right"><nobr>{{var row_item.qty|formatDecimal}}</nobr></td>\n  <td align="right"><nobr>{{var row_item.row_totalInclTax|formatPrice}}</nobr></td>\n</tr>\n', NULL, NULL, 1, 'Abandoned cart row', 'AW', 'aw@aw.com', 1, '2013-11-13 04:32:22', '2013-11-13 04:32:22'),
