(8, 'AW Order row', '\n<tr>\n  <td>{{var row_item_row_number}}</td> \n  <td><a href="{{store url="catalog/product/view" id="$row_item.product.id"}}">{{var row_item.name}}</a></td>\n  <td align="center"><img src="{{thumbnail size="75" source="row_item.product"}}"/></td>\n  <td>{{var row_item.product.description}}&nbsp;</td>\n  <td align="right"><nobr>{{var row_item.price|formatPrice}}</nobr></td>\n  <td align="right"><nobr>{{var row_item.qtyOrdered|formatDecimal}}</nobr></td>\n  <td align="right"><nobr>{{var row_item.row_total|formatPrice}}</nobr></td>\n</tr>\n', NULL, NULL, 1, 'Order row', 'AW', 'aw@aw.com', 1, '2013-11-13 04:32:22', '2013-11-13 04:32:22'),
